import React, { useState } from 'react'
import { Container, Card, Row, Col, Table } from "react-bootstrap"
import {workouts as data} from '../workouts'

const WorkoutScreen = ({match}) => {

const [workouts, setWorkouts] = useState(data)
const workout = workouts[match.params.id - 1] 

    return (
        <>
            { workout
            ?   (
                <Row className="mt-5">
                    <Col md={6}>
                        <h1>{workout.description}</h1>
                        <h3>
                            On {`${workout.date.substring(8,10)}.${workout.date.substring(5,7)}, ${workout.date.substring(11,16)} `}
                        </h3>
                        <div>
                            {`Price: ${workout.revenuePerClient} shekels`}
                        </div>
                        <div>
                            Duration: {
                            workout.duration > 1 
                            ? `${workout.duration} hours` 
                            : `${workout.duration} hour` 
                            }
                        </div>
                    </Col>
                </Row>
                )
            : (<div>not hey</div>)
            }   
        </>
    )
}

export default WorkoutScreen
